import React from 'react';
import './card.css'

class Card extends React.Component {
  render () {
    return (
    <div className="card">
      <img id="image" alt="displayImg" src={this.props.image}/>
      <div id="content">
      <h1 id="title">{this.props.title}</h1>
      <h3 id="technologies">{this.props.technologies}</h3>
      <p id="description">{this.props.description}</p>
      </div>
      <div id="buttons">
        <p id="code">Code</p>
        <p id="demo">Demo</p>
      </div>      
    </div>
  );
}
}

export default Card;
